// src/screens/StaffDetailsScreen.js
import React from 'react';
import { View, Text } from 'react-native';

const StaffDetailsScreen = () => {
  return (
    <View>
      <Text>Staff Details Screen</Text>
    </View>
  );
};

export default StaffDetailsScreen;
